function simulate_mouse_click(element, eventName)
{
    var options = extend(defaultOptions, arguments[2] || {});
    var oEvent, eventType = null;

    for (var name in eventMatchers)
    {
        if (eventMatchers[name].test(eventName)) { eventType = name; break; }
    }

    if (!eventType)
        throw new SyntaxError('Only HTMLEvents and MouseEvents interfaces are supported');

    if (document.createEvent)
    {
        oEvent = document.createEvent(eventType);
        if (eventType == 'HTMLEvents')
        {
            oEvent.initEvent(eventName, options.bubbles, options.cancelable);
        }
        else
        {
            oEvent.initMouseEvent(eventName, options.bubbles, options.cancelable, document.defaultView,
            options.button, options.pointerX, options.pointerY, options.pointerX, options.pointerY,
            options.ctrlKey, options.altKey, options.shiftKey, options.metaKey, options.button, element);
        }
        element.dispatchEvent(oEvent);
    }
    else
    {
        options.clientX = options.pointerX;
        options.clientY = options.pointerY;
        var evt = document.createEventObject();
        oEvent = extend(evt, options);
        element.fireEvent('on' + eventName, oEvent);
    }
    return element;
}

function select_chart_period(event) {

    const chart_filters = document.getElementsByClassName("chart__range-selection"),
    search_el = event.innerText;

    for (i = 0; i < chart_filters.length; i++) {
        _element = chart_filters[i];
        if (_element.innerHTML == search_el) {
            simulate_mouse_click(_element, "click");
        }
    }

}

function extend(destination, source) {
    for (var property in source)
      destination[property] = source[property];
    return destination;
}

var eventMatchers = {
    'HTMLEvents': /^(?:load|unload|abort|error|select|change|submit|reset|focus|blur|resize|scroll)$/,
    'MouseEvents': /^(?:click|dblclick|mouse(?:down|up|over|move|out))$/
}
var defaultOptions = {
    pointerX: 0,
    pointerY: 0,
    button: 0,
    ctrlKey: false,
    altKey: false,
    shiftKey: false,
    metaKey: false,
    bubbles: true,
    cancelable: true
} 
 
 
 function build_charts(size,margin1,margin2,margin3) {

     var parseDate = d3.timeParse('%Y-%m-%d');
     var chart_dict = {},
     insert_row = {};
     chart_data = get_data_to_js('/query_data?view_id=markets_index_data');
     const header = chart_data[0];
     const ticker = header.indexOf('index_id'),
     date = header.indexOf('date'),
     volume = header.indexOf('volume'),
     close_price = header.indexOf('close_price');

     for (i = 1; i < chart_data.length; i++) {
         const row = chart_data[i];
         insert_row = {
             date: parseDate(row[date].substring(0, 10)),
             price: Math.round(row[close_price] * 100) / 100 ,//.toFixed(2),//Math.round(row[close_price]) , 
             volume: row[volume]
         }
         try {
             chart_dict[row[ticker]].push(insert_row);
         } catch (error) {
             chart_dict[row[ticker]] = [insert_row]
         }
     }
	 
	 stock_price_chart
	 Object.entries(chart_dict).forEach(([key, value]) => {
   stock_price_chart(value,"id_chart".concat(key.replace('^','_').replace('.','_')),size,margin1,margin2,margin3);
});
 }

 function set_headers_info() {
     var data_arr = get_data_to_js('/query_data?table=sec_history_manager');    
     const header = data_arr[0];
     const ticker = header.indexOf('ticker'),
		   sec_name = header.indexOf('sec_name'),
		   description = header.indexOf('description');

     for (i = 1; i < data_arr.length; i++) {
		 const row=data_arr[i];
		 const key_id=row[ticker];
		 document.getElementById("title".concat(key_id)).innerHTML=row[sec_name];
		 document.getElementById("tooltip".concat(key_id)).setAttribute("data-title", row[description]);

     }
 }


 
